import React from 'react';
import Button from 'antd/lib/button';
import './App.css';
import Demo from './DirTree.js'

function App() {
  return (
    <div className="App">
     <Layout>
      <Header></Header>
      <Content><Demo></Demo>
        <Button type="primary">Button</Button></Content>
      <Footer></Footer>
    </Layout>

      </div>
  );
}


export default App;
